import {Tab} from "fresh-design-system";

export default {
    title: "Tab",
    Component: Tab,
}


const Template = (args) => <Tab {...args} />;

export const SimpleTab = Template.bind({});
SimpleTab.args = {
    items: [
        {
            label: 'Hot dishes',
            content: <div>Tab 1 - content</div>
        },
